import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route, Switch } from 'react-router-dom';
import NavBar from './components/nav/NavBar';
import Users from './components/content/admin/Users';
import RecipieList from './components/content/recipies/RecipieList';
import RecipieView from './components/content/recipies/RecipieView';
import Home from './components/content/Home';
import Login from './components/user/Login';
import User from './components/content/admin/User';
import './App.css';

// import { renderIntoDocument } from 'react-dom/test-utils';


class App extends Component {
  state = {  } 
  render(
  ) { 
    return (
      <div>
        <div className="content">
          {/* <h1>App component</h1> */}
              <NavBar />
              {/* <Routes> */}
                <Route path="/" element={<Home/>} />
                <Route path="/recipies/:recipe/" 
                  element={
                    <RecipieView/>
                   } />
                <Route path="/recipies" element={<RecipieList/>} />
                <Route path="/admin/users/:userId" render={(props) => <User {...props}/>} />
                <Route path="/admin/users" element={<Users/>} />
                <Route path="/user/login" element={<Login/>} />
              {/* </Routes>     */}
        </div>
    </div>
    );
  }
}


export default App;
